    [],nt"revision_timestamp": "2015-12-08T21:04:31.447338",nt"name": "mongolia-peri-urban-rangeland-phase-2",nt"isopen":
    false,nt"url": null,nt"notes": " n        This study is an impact evaluation
    on the overall effect of the PURP on both project recipients and their neighbors.
    Key outcomes are household agricultural income, milk yields from cattle, and restriction
    of herd size to the carrying capacity of the land. A separate but coordinated study
    will examine the long term effect of the project on land degradation patterns. In
    Phase 2 areas, eligible applicants to the project were entered into a lottery and
    half of them were randomly selected to become project beneficiaries. Thus a very
    clean control group was created to determine the causal impacts of the project.n
